import React from "react";
import { Card, Image } from "semantic-ui-react";

const Game = props => {
  const { game } = props;
  return (
    <div className="card_wrapper">
      <div className="card">

        <img src={game.img} />
        <div className="card_content">
          <div className="card_content__header">Game Name: {game.title}</div>
          <div className="card_content__description">
            Game Description:{game.details}
          </div>
          <div className="card_content__price">Game Price:{game.price}</div>
        </div>
      </div>
    </div>
  );
};

export default Game;
